　メーカー希望小売価格はメーカーカタログに基づいて掲載しています<br>メーカー希望小売価格はメーカー商品タグに基づいて掲載しています<br><img src="http://image.rakuten.co.jp/kemari87/cabinet/evidence.gif" border="0"><br><br>

<div class="div_tilele_1">商品詳細</div>

アシックス、レディースサッカースパイク。<br>
女性の足型研究から生まれたウイメンズ専用ラストを採用し、シューズと足との優れた一体感を実現。アッパー両サイドに配置したパネルがハトメ補強と連動し、ヒモ締め効果によるフィット性が向上。ミッドソールを搭載することで、優れたクッション性を発揮し、下肢への負担を軽減。アウターソールには軽量樹脂「Solyte Polymer」、ミッドソールには「Solyte」を採用し、軽量化を実現。<br><br>
アッパー：人工皮革<br>
アウトソール：合成底(Solyte Polymer)<br>
インソール：取替可<br>
シューズタイプ：レギュラーフィット(レディースレギュラー)<br>
対応グラウンド：天然芝グラウンド、土グラウンド、人工芝グラウンド<br>
カラー：エレクトリックブルー×ホワイト<br>
