<div class="div_tilele_1">商品詳細</div>

アシックス、レディースサッカースパイク。<br>
女性の足型研究から生まれたウイメンズ専用ラストを採用。また、アッパー前足部にはカンガルー表革を採用し、シューズと足の優れた一体感を実現。アッパー両サイドに配置したパネルがハトメ補強と連動し、紐締め効果によるフィット性が向上。ミッドソールを搭載することで、優れたクッション性を発揮し、下肢への負担を軽減。消臭機能と吸湿速乾性に優れたシャインアップ+ウォーターマジック素材の中敷が、シューズ内の快適性を実現。アウターソールには軽量樹脂「Solyte Polymer」、ミッドソールと中敷には「Solyte」を採用し、軽量化を実現。<br><br>
アッパー：人工皮革、天然皮革(カンガルー皮革)<br>
アウトソール：合成底(Solyte Polymer)<br>
インソール：取替可<br>
シューズタイプ：レギュラーフィット(レディースレギュラー)<br>
対応グラウンド：天然芝グラウンド、土グラウンド、人工芝グラウンド<br>
カラー：パールホワイト×エレクトリックブルー<br>
発売：2016年2月(NEWカラー)<style type="text/css">

