アディダス、トレーニングシューズ、レッドリミットパック。<br>
完璧なボールコントロールを追求したトレシュー、ベーシックモデル。前足部全面にグリップ性を追求したプリント加工を施した進化版プライムメッシュアッパーが正確なボールコントロール精度に貢献。伸縮性に優れたコンプレッションフィットソックスが足とシューズとの優れた一体感を実現。土・人工芝グラウンド対応。<br><br>
アッパー：合成繊維、合成皮革<br>
アウトソール：ゴム底<br>
対応グラウンド：屋外コート(ターフコート)<br>
カラー：レッド×ランニングホワイト×コアブラック<br>
